import Input from "./Input";
import classes from "./ItemForm.module.css";
const ItemForm = pro => {
  return (
    <form className={classes.form}>
      <Input
        label={Amount}
        input={{
          id: "Amount",
          type: "number",
          min: 1,
          max: 5,
          step: 1,
          defaultValue: 1,
        }}
      />
      <button className={classes[".form button"]}>Add</button>
    </form>
  );
};
export default ItemForm;
